import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid, { GridSpacing } from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import Hgrid from '../../organisms/health/Hgrid';
import Hpagenation from '../../organisms/health/Hpagenation';
import ButtonAppBar from '../../shared/Appbar';
import Htop from '../../organisms/health/Htop';
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(3),
    maxWidth: 1200,
    marginTop : 150,
  },
  image: {
    width: 150,
    height: 125,
  },
  img: {
    display: 'block',
    maxWidth: '100%',
    maxHeight: '100%',
  },
  control: {
      padding: theme.spacing(2),
    },
}));

export default function SpacingGrid() {
  const [spacing, setSpacing] = React.useState<GridSpacing>(2);
  const classes = useStyles();

  const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSpacing(Number((event.target as HTMLInputElement).value) as GridSpacing);
  };

  return (
    <div className={classes.root}>
    <ButtonAppBar/>
    <Htop/>
      <div style={{width: '70%', margin: '30px auto'}}>
          <Paper className={classes.paper} variant="outlined">
            <Typography>판매 등록일</Typography>
            <Typography variant="h5">(제목입니다) 헬스장 양도합니다. *북문근처에요!!</Typography>
            <Grid container className={classes.root} spacing={2}>
              <Grid item xs={12}>
                <Grid container justify="flex-start" spacing={spacing}>
                    <Grid item>
                      <Typography>위치</Typography>
                    </Grid>
                    <Grid item>
                      <Typography>네버랜드 112동</Typography>
                    </Grid>
                </Grid>
              </Grid>
            </Grid>
            <Grid container className={classes.root} spacing={2}>
              <Grid item xs={12}>
                <Grid container justify="flex-start" spacing={spacing}>
                    <Grid item>
                      <Typography>양도금</Typography>
                    </Grid>
                    <Grid item>
                      <Typography>없음</Typography>
                    </Grid>
                </Grid>
              </Grid>
            </Grid>
            <Grid container className={classes.root} spacing={2}>
              <Grid item xs={12}>
                <Grid container justify="flex-start" spacing={spacing}>
                    <Grid item>
                      <Typography>기한</Typography>
                    </Grid>
                    <Grid item>
                      <Typography>3개월</Typography>
                    </Grid>
                </Grid>
              </Grid>
            </Grid>
            <Grid>
            위치는 네버랜드 112동입니다. 자유관이랑 3분거리에요! 학교랑 가깝습니당 그래서 도서관 왔다갔다하기도 정말 편해요ㅎㅎ

집 구조, 옵션 : 방 크기는 네버랜드에서 제일 큰 방이에요! 웬만한 원룸보다는 크다고 보시면 돼요. 
집도 깔끔한 화이트톤이고 벌레 나온적 한번도 없어용 주방 분리형이고 창문이 세개라 환기가 진짜 엄청 잘됩니다. 
옵션은 세탁기, 전자레인지, 냉장고, 책상, 의자, 옷장, 침대 있습니다! 
그리고 집에 거울이나 빨래건조대 등 제가 들여놓은 물건들 중에 쓰고 싶으신거 있으면 놔두고 가겠습니다~

보증금, 월세 : 보증금은 무보증금이구요, 월세는 45만원인데 제가 5만원 지원해서 40만원에 해드리겠습니다! 
월세가 비싸다고 생각하실 수 있는데 그만큼 집이 넓고 깔끔합니다❤️
전기세랑 도시가스비만 별도고 나머지는 다 월세에 포함이에요! 근데 에어컨 하루종일 틀고 가스 자주써도 진짜 얼마안나와용

기간 : 10월~2월 말쯤

더 궁금한거 있으시면 댓글의 오픈채팅 통해 연락주세요! 연락주시면 방사진도 보내드리겠습니다~~
            </Grid>
          </Paper>
      </div>
    </div>
  );
}
